import './App.css';
import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import { BrowserRouter, Routes, Route } from 'react-router-dom';



function App() {
  return (
    <div>

        <Route>
        <Header/>
          <Routes path="AddTimeTable" element={<AddTimeTable/>}/>



        </Route>

        </div>



  );
}

export default App;
